fields.description:
Наша JSN-team стремительно растет, в связи с этим мы ищем Back-end разработчиков с высоким уровнем мотивации и желанием развиваться в направлении Full Stack.

О нас.

Компания JSN на протяжении 5ти лет успешно работает на американский и немецкий рынок в сфере разработки/поддержки WEB и mobile приложений.

Технологиии, с которыми работаем.

Front-end — Angular 1+, React.js, Vue.js, D3.js, jQuery, Backbone.js, Passport.js, Bootstrap.
Back-end — Node.js (Express, Nest.js, Next.js, Nuxt.js, Serverless), PHP (Laravel, Symfony, CodeIgniter, Yii½), Python (Django, Bottle, Flex).
Условия, для Вас:

уютный, светлый, просторный офис в центре г. Запорожья;
молодой, дружелюбный коллектив, построенный на принципах взаимопомощи;
комфортное рабочее место с двумя мониторами и удобным креслом;
MacBooks и iPhones для тестирования;
чай/кофе/молоко/фрукты/шоколадки/печеньки;
English lessons;
обучающие митапы компании;
посещение IT конференций, как в Украине, так и за ее пределами;
регулярные корпоративные мероприятия;
карьерный и финансовый рост;
бонусы за высокое качество, высокую скорость выполнения задач и др.
официальное оформление после испытательного срока;
5-ти дневная рабочая неделя (8-и часовой рабочий день).
Требования:

опыт работы разработчиком — не менее полугода;
Javascript;
PHP (OOP, MVC) и/или Node.js и/или Python;
MySQL, NoSQL, PostgreSQL;
Git;
Linux.
От Вас мы ожидаем:

ответственный подход к работе;
написание качественного кода;
умение работать в команде и взаимодействовать с менеджерами;
внимательность к деталям;
желание учиться и постоянно совершенствовать свои навыки;
желание повышать уровень английского языка (посещать курсы).
Если Вы видите себя частью нашей команды, тогда отправляйте свое резюме и контакты! Мы свяжемся с Вами в ближайшее время!

https://www.jsninjas.net

https://www.facebook.com/jsninjas/
